import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Routes
} from "react-router-dom";

import Login from './components/pages/Login';

const App = () => {
  return (

    <Router>
      <div>
        <Routes path='/login'>
          <Login />
        </Routes>
      </div>
    </Router>

  )
}

export default App
